	padding-top:15px;
	float:left;
	position:relative;
	border-right:#DDD solid 1px;
	border-bottom:#DDD solid 1px;
	text-align:center;
}
div:before,div:after{
	content:'';
	display:block;
	position:absolute;
	background:#DDD;
}
div:before{
	width:100%;
	height:1px;
	left:0;
	top:-1px;
}
div:after{
	height:100%;
	width:1px;
	top:0;
	left:-1px;
}
div code{
	display:block;
	position:absolute;
	width:90%;
	padding:0 5%;
	text-align:center;
	left:0;
	bottom:0;
	background:#FFF;
	display:none;
}
div:hover code{
	/*display:block;*/
}
*{font-size:28px}
